'''Yáviérë''' was the harvest feast-day of the [[Stewards' Reckoning]] of [[Gondor]], lying between the months of [[Yavannië]] and [[Narquelië]], near the autumnal equinox.<ref>{{HM|Guide}}, entry "Yáviérë"</ref> On a modern calendar, Yáviérë would have fallen on [[21 September|September 21]]st.
